import React, { useState, useEffect } from 'react';
import { API_BASE_URL } from '../constant';
import { Plane, PlusSquare, CheckSquare, X, AlertCircle } from 'lucide-react';
import { preventZooming } from '../utils/helpers';

export default function AddAirplane() {
  const [airlineID, setAirlineID] = useState('');
  const [tailNum, setTailNum] = useState('');
  const [seatCapacity, setSeatCapacity] = useState('');
  const [speed, setSpeed] = useState('');
  const [locationID, setLocationID] = useState('');
  const [planeType, setPlaneType] = useState('');
  const [maintenanced, setMaintenanced] = useState(false);
  const [model, setModel] = useState('');
  const [neo, setNeo] = useState(false);
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // Set the document title
    document.title = 'Add Airplane | Airline Management System';

    // Prevent zooming
    preventZooming && preventZooming();
  }, []);

  const handleAddAirplane = async () => {
    setMessage('');
    setError('');
    setLoading(true);

    if (!airlineID || !tailNum || !planeType) {
      setError('Airline ID, Tail Number, and Plane Type are required.');
      setLoading(false);
      return;
    }

    try {
      const response = await fetch(`${API_BASE_URL}/procedures/add_airplane`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          airlineID: airlineID,
          tail_num: tailNum,
          seat_capacity: parseInt(seatCapacity) || 0,
          speed: parseInt(speed) || 0,
          locationID: locationID,
          plane_type: planeType,
          maintenanced: maintenanced,
          model: model,
          neo: neo,
        }),
      });

      if (response.ok) {
        const data = await response.json();
        setMessage(data.message || 'Airplane added successfully!');
        setAirlineID('');
        setTailNum('');
        setSeatCapacity('');
        setSpeed('');
        setLocationID('');
        setPlaneType('');
        setMaintenanced(false);
        setModel('');
        setNeo(false);
      } else {
        const errorData = await response.json();
        setError(errorData.error || 'Failed to add airplane.');
      }
    } catch (err) {
      console.error('Error adding airplane:', err);
      setError('An unexpected error occurred.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="bg-gray-50 text-gray-900 min-h-screen">
      <div className="container mx-auto px-4 py-8 max-w-3xl">
        <header className="mb-8">
          <h1 className="text-3xl font-bold mb-2 flex items-center">
            <Plane className="w-8 h-8 mr-3" />
            Add Airplane
          </h1>
          <p className="text-gray-500 font-mono">Register a new airplane in the system</p>
        </header>

        {message && (
          <div className="bg-green-50 border border-green-200 text-green-700 px-4 py-3 rounded mb-6 flex items-center">
            <CheckSquare className="w-5 h-5 mr-2" />
            <span>{message}</span>
          </div>
        )}

        {error && (
          <div className="bg-red-50 border border-red-200 text-red-700 px-4 py-3 rounded mb-6 flex items-center">
            <AlertCircle className="w-5 h-5 mr-2" />
            <span>{error}</span>
          </div>
        )}

        <div className="bg-white p-6 rounded-lg shadow-sm border border-gray-200">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="form-group">
              <label className="block text-sm font-medium text-gray-700 mb-1">Airline ID</label>
              <input
                type="text"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={airlineID}
                onChange={(e) => setAirlineID(e.target.value)}
                placeholder="Enter airline ID"
              />
            </div>

            <div className="form-group">
              <label className="block text-sm font-medium text-gray-700 mb-1">Tail Number</label>
              <input
                type="text"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={tailNum}
                onChange={(e) => setTailNum(e.target.value)}
                placeholder="Enter tail number"
              />
            </div>

            <div className="form-group">
              <label className="block text-sm font-medium text-gray-700 mb-1">Seat Capacity</label>
              <input
                type="number"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={seatCapacity}
                onChange={(e) => setSeatCapacity(e.target.value)}
                placeholder="Enter seat capacity"
              />
            </div>

            <div className="form-group">
              <label className="block text-sm font-medium text-gray-700 mb-1">Speed</label>
              <input
                type="number"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={speed}
                onChange={(e) => setSpeed(e.target.value)}
                placeholder="Enter speed"
              />
            </div>

            <div className="form-group">
              <label className="block text-sm font-medium text-gray-700 mb-1">Location ID</label>
              <input
                type="text"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={locationID}
                onChange={(e) => setLocationID(e.target.value)}
                placeholder="Enter location ID"
              />
            </div>

            <div className="form-group">
              <label className="block text-sm font-medium text-gray-700 mb-1">Plane Type</label>
              <input
                type="text"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={planeType}
                onChange={(e) => setPlaneType(e.target.value)}
                placeholder="Enter plane type"
              />
            </div>

            <div className="form-group">
              <label className="block text-sm font-medium text-gray-700 mb-1">Model</label>
              <input
                type="text"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={model}
                onChange={(e) => setModel(e.target.value)}
                placeholder="Enter model"
              />
            </div>

            <div className="form-group flex items-center">
              <div className="flex items-center h-full mt-6">
                <div className="mr-6">
                  <label className="flex items-center text-sm font-medium text-gray-700">
                    <input
                      type="checkbox"
                      className="h-4 w-4 text-blue-600 mr-2"
                      checked={maintenanced}
                      onChange={(e) => setMaintenanced(e.target.checked)}
                    />
                    Maintenanced
                  </label>
                </div>

                <div>
                  <label className="flex items-center text-sm font-medium text-gray-700">
                    <input
                      type="checkbox"
                      className="h-4 w-4 text-blue-600 mr-2"
                      checked={neo}
                      onChange={(e) => setNeo(e.target.checked)}
                    />
                    NEO
                  </label>
                </div>
              </div>
            </div>
          </div>

          <div className="mt-8">
            <button 
              onClick={handleAddAirplane} 
              disabled={loading}
              className="flex items-center justify-center bg-blue-600 hover:bg-blue-700 text-white py-2 px-6 rounded-md font-medium focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 disabled:opacity-50 disabled:cursor-not-allowed"
            >
              <PlusSquare className="w-5 h-5 mr-2" />
              {loading ? 'Adding...' : 'Add Airplane'}
            </button>
          </div>
        </div>
      </div>

      <footer className="w-full py-4 mt-12 border-t border-gray-200">
        <div className="container mx-auto px-4 text-center text-gray-500 text-sm">
